import React, { useRef } from 'react';
import './App.css';
import Footer from './component/Footer';
import Header from './component/Header';
import Main from './Main';

function App() {
  const contactRef = useRef<HTMLDivElement>(null);
  return (
    <div className="App">
      <header className="App-header">
      <Header/>
        <Main ref={contactRef}/>
      </header>
      <Footer/>
    </div>
  );
}

export default App;
